import React, { useMemo } from 'react';
import { motion } from 'framer-motion';
import { FaGithub, FaExternalLinkAlt } from 'react-icons/fa';
import './Projects.css';

const Projects = ({ theme }) => {
  const projects = useMemo(() => [
    {
      id: 1,
      title: "E-Commerce Platform",
      description: "A full-stack e-commerce application built with React, Node.js, and MongoDB. Features include user authentication, product management, shopping cart, and payment integration.",
      tech: ["React", "Node.js", "MongoDB", "Express", "JWT", "Stripe"],
      github: "https://github.com/nyanaung23/ecommerce-platform",
      live: "https://ecommerce-demo.vercel.app"
    },
    {
      id: 2,
      title: "Task Management App",
      description: "A collaborative task management tool with real-time updates, drag-and-drop functionality, and team collaboration features. Built with modern web technologies.",
      tech: ["React", "TypeScript", "Socket.io", "PostgreSQL", "Redis", "Docker"],
      github: "https://github.com/nyanaung23/task-manager",
      live: "https://taskmanager-demo.netlify.app"
    },
    {
      id: 3,
      title: "Weather Dashboard",
      description: "A responsive weather application that provides current weather conditions, forecasts, and interactive maps. Integrates with multiple weather APIs for accurate data.",
      tech: ["JavaScript", "CSS3", "HTML5", "Chart.js", "OpenWeather API"],
      github: "https://github.com/nyanaung23/weather-dashboard",
      live: "https://weather-app-demo.herokuapp.com"
    },
    {
      id: 4,
      title: "Social Media Analytics",
      description: "A comprehensive analytics dashboard for social media metrics. Features data visualization, trend analysis, and automated reporting capabilities.",
      tech: ["Python", "Django", "React", "D3.js", "PostgreSQL", "Celery"],
      github: "https://github.com/nyanaung23/social-analytics",
      live: "https://social-analytics-demo.railway.app"
    },
    {
      id: 5,
      title: "AI Chatbot Assistant",
      description: "An intelligent chatbot powered by machine learning algorithms. Provides natural language processing, context awareness, and multi-platform integration.",
      tech: ["Python", "TensorFlow", "Flask", "NLTK", "OpenAI API", "Redis"],
      github: "https://github.com/nyanaung23/ai-chatbot",
      live: "https://ai-chatbot-demo.streamlit.app"
    },
    {
      id: 6,
      title: "Portfolio Website",
      description: "A modern, responsive portfolio website showcasing projects, skills, and experience. Built with React and Framer Motion for smooth animations.",
      tech: ["React", "Framer Motion", "CSS3", "JavaScript", "Vercel"],
      github: "https://github.com/nyanaung23/portfolio",
      live: "https://nyanaung.dev"
    }
  ], []);

  const sectionStyles = useMemo(() => ({
    '--projects-bg': theme === 'dark' ? 'linear-gradient(135deg, #042a1c 0%, #042a1c 100%)' : 'linear-gradient(135deg, #EEEEEE 0%, #EEEEEE 100%)',
    '--projects-title-color': theme === 'dark' ? '#e3e5e6' : '#000000',
    '--text-shadow-1': theme === 'dark' ? '#0d4f3c' : '#374151',
    '--text-shadow-2': theme === 'dark' ? '#1a5f4a' : '#4b5563',
    '--text-shadow-3': theme === 'dark' ? '#2d6b58' : '#6b7280',
    '--text-shadow-4': theme === 'dark' ? '#407766' : '#9ca3af',
    '--project-card-bg': theme === 'dark' ? 'linear-gradient(135deg, #0a2e1f 0%, #1a4a35 100%)' : 'linear-gradient(135deg, #ffffff 0%, #f8fafc 100%)',
    '--project-card-shadow-1': theme === 'dark' ? 'rgba(0, 0, 0, 0.4)' : 'rgba(0, 0, 0, 0.08)',
    '--project-card-shadow-2': theme === 'dark' ? 'rgba(0, 0, 0, 0.3)' : 'rgba(0, 0, 0, 0.06)',
    '--project-card-shadow-hover-1': theme === 'dark' ? 'rgba(0, 0, 0, 0.5)' : 'rgba(0, 0, 0, 0.12)',
    '--project-card-shadow-hover-2': theme === 'dark' ? 'rgba(0, 0, 0, 0.4)' : 'rgba(0, 0, 0, 0.08)',
    '--project-card-border': theme === 'dark' ? '#1a4a35' : '#e2e8f0',
    '--project-title-color': theme === 'dark' ? '#e3e5e6' : '#000000',
    '--project-description-color': theme === 'dark' ? '#a0aec0' : '#4a5568',
    '--tech-tag-bg': theme === 'dark' ? '#1a4a35' : '#f7fafc',
    '--tech-tag-color': theme === 'dark' ? '#e3e5e6' : '#2d3748',
    '--tech-tag-border': theme === 'dark' ? '#2d6b58' : '#e2e8f0',
    '--project-link-color': theme === 'dark' ? '#e3e5e6' : '#4a5568',
    '--project-link-border': theme === 'dark' ? '#2d6b58' : '#e2e8f0',
    '--project-link-hover-bg': theme === 'dark' ? '#2d6b58' : '#f7fafc',
    '--project-link-hover-color': theme === 'dark' ? '#e3e5e6' : '#2d3748'
  }), [theme]);

  return (
    <section 
      id="projects" 
      className="projects-section"
      style={sectionStyles}
    >
      <div className="projects-container">
        <motion.div
          className="projects-header"
          initial={{ opacity: 0, y: -30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.4, delay: 0.1, ease: "easeOut" }}
          viewport={{ once: false }}
        >
          <motion.h2
            className="projects-title text-shadows"
            initial={{ opacity: 0, scale: 0.9 }}
            whileInView={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.3, delay: 0.2, ease: "easeOut" }}
            viewport={{ once: false }}
          >
            Projects
          </motion.h2>
        </motion.div>

        <div className="projects-grid">
          {projects.map((project, index) => (
            <motion.div
              key={project.id}
              className="project-card"
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1, ease: "easeOut" }}
              viewport={{ once: true }}
            >
              <div className="project-image">
                <div className="project-placeholder">ðŸ“±</div>
              </div>

              <div className="project-content">
                <h3 className="project-title">{project.title}</h3>
                <p className="project-description">{project.description}</p>

                <div className="project-tech">
                  {project.tech.map((tech, techIndex) => (
                    <span key={techIndex} className="tech-tag">
                      {tech}
                    </span>
                  ))}
                </div>

                <div className="project-links">
                  <a 
                    href={project.github} 
                    className="project-link primary"
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    <FaGithub className="project-link-icon" />
                    Code
                  </a>
                  <a 
                    href={project.live} 
                    className="project-link secondary"
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    <FaExternalLinkAlt className="project-link-icon" />
                    Live Demo
                  </a>
                </div>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
